@test integrate((c+d*x)^4*sin(a+b*x), x) == :(-1*b^-1*(c+d*x)^4*cos(a+b*x)+-24*b^-5*d^4*cos(a+b*x)+-24*b^-4*d^3*(c+d*x)*sin(a+b*x)+4*d*b^-2*(c+d*x)^3*sin(a+b*x)+12*b^-3*d^2*(c+d*x)^2*cos(a+b*x))
