@test integrate((c+d*x)^2*sin(a+b*x)^2, x) == :(1//6*d^-1*(c+d*x)^3+-1//4*x*b^-2*d^2+(1/2)*d*b^-2*sin(a+b*x)^2*(c+d*x)+-1//2*b^-1*(c+d*x)^2*cos(a+b*x)*sin(a+b*x)+1//4*b^-3*d^2*cos(a+b*x)*sin(a+b*x))
